pub enum Cw1155ExecuteMsg {
    SendFrom {
        from: String,
        to: String,
        token_id: TokenId,
        value: Uint128,
        msg: Option<Binary>,
    },
    BatchSendFrom {
        from: String,
        to: String,
        batch: Vec<(TokenId, Uint128)>,
        msg: Option<Binary>,
    },
    Mint {
        to: String,
        token_id: TokenId,
        value: Uint128,
        msg: Option<Binary>,
    },
    BatchMint {
        to: String,
        batch: Vec<(TokenId, Uint128)>,
        msg: Option<Binary>,
    },
    Burn {
        from: String,
        token_id: TokenId,
        value: Uint128,
    },
    BatchBurn {
        from: String,
        batch: Vec<(TokenId, Uint128)>,
    },
    ApproveAll {
        operator: String,
        expires: Option<Expiration>,
    },
    RevokeAll {
        operator: String,
    },
}

pub enum Cw1155QueryMsg {
    Balance {
        owner: String,
        token_id: TokenId,
    },
    BatchBalance {
        owner: String,
        token_ids: Vec<TokenId>,
    },
    ApprovedForAll {
        owner: String,
        include_expired: Option<bool>,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    IsApprovedForAll {
        owner: String,
        operator: String,
    },
    TokenInfo {
        token_id: TokenId,
    },
    Tokens {
        owner: String,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    AllTokens {
        start_after: Option<String>,
        limit: Option<u32>,
    },
}
